module.exports = "<article class=\"container\" style=\"padding: 2em;\">\n    <div>\n        <span class=\"close\" (click)=\"dialogRef.close()\" style=\"top: 0; padding: 0\">x</span>\n        <h3>Privacy Policy</h3>\n    </div>\n    <hr>\n    <ol type=\"1\">\n        <li>\n            <h4> Introduction</h4>\n        </li>\n        <p>\n            We at Dynamic Group of Foundations respect your right to privacy and comply with our obligations under the Data Protection\n            Acts 1988 and 2002. The purpose of this Website Privacy Policy is to outline how we deal with any personal data\n            you provide to us while visiting this website. Naturally, if you are not happy with this Website Privacy Policy,\n            you should not use this website.\n        </p>\n        <p>\n            By visiting this website, you are accepting the terms of this Website Privacy Policy. Any external links to other websites\n            are clearly identifiable as such, and we are not responsible for the content or the privacy policies of these\n            other websites.\n        </p>\n\n        <li>\n            <h4>Types of Information Collected</h4>\n        </li>\n        <h5>Personal Data:</h5>\n        <p>\n            This is data that identifies you or can be used to identify or contact you and may include your name, address, email address,\n            user IP addresses in circumstances where they have not been deleted, clipped or anonymised, telephone number,\n            birth date and billing and credit card information. Such information is only collected from you if you voluntarily\n            submit it to us.\n        </p>\n        <h5>Non-Personal Data:</h5>\n        <p>\n            Like most websites, we gather statistical and other analytical information collected on an aggregate basis of all visitors\n            to our website. This Non-Personal data comprises information that cannot be used to identify or contact you,\n            such as demographic information regarding, for example, user IP addresses where they have been clipped or anonymised,\n            browser types and other anonymous statistical data involving the use of our website.\n        </p>\n\n        <li>\n            <h4>Purposes for which we hold your Information</h4>\n        </li>\n        <h5>Non-Personal Data:</h5>\n        <p>\n            We use the Non-Personal Data gathered from visitors to our website in an aggregate form to get a better understanding of\n            where our visitors come from and to help us better design and organize our website.\n        </p>\n        <h5>Personal Data:</h5>\n        <p>We will process any Personal Data you provide to us for the following purposes:\n        </p>\n        <ol type=\"a\">\n            <li>To provide you with the goods or services you have ordered</li>\n            <li>To contact you if required in connection with your order or to respond to any communications you might send to\n                us\n            </li>\n        </ol>\n        <br>\n        <li>\n            <h4>Disclosure of Information to Third Parties</h4>\n        </li>\n        <p>We may provide Non-Personal Data to third parties, where such information is combined with similar information of\n            other users of our website. For example, we might inform third parties regarding the number of unique users who\n            visit our website, the demographic breakdown of our community users of our website, or the activities that visitors\n            to our website engage in while on our website. The third parties to whom we may provide this information may\n            include e.g. potential or actual advertisers, providers of advertising services (including website tracking services),\n            commercial partners, sponsors, licensees, researchers and other similar parties).\n        </p>\n        <p>We will not disclose your Personal Data to third parties unless you have consented to this disclosure or unless the\n            third party is required to fulfil your order (in such circumstances, the third party is bound by similar data\n            protection requirements).</p>\n\n        <p>\n            We will disclose your Personal Data if we believe in good faith that we are required to disclose it in order to comply with\n            any applicable law, a summons, a search warrant, a court or regulatory order, or other statutory requirement.\n        </p>\n\n        <li>\n            <h4>Security</h4>\n        </li>\n        <p>Your Personal Data is held on secure servers hosted by Airtel, our Internet Service Provider. The nature of the Internet\n            is such that we cannot guarantee or warrant the security of any information you transmit to us via the Internet.\n            No data transmission over the Internet can be guaranteed to be 100% secure. However, we will take all reasonable\n            steps (including appropriate technical and organizational measures) to protect your Personal Data.</p>\n\n        <li>\n            <h4>Updating, Verifying and Deleting Personal Data</h4>\n        </li>\n        <p>\n            You may inform us of any changes in your Personal Data, and in accordance with our obligations under the Data Protection\n            Acts 1988 and 2002 we will update or delete your Personal Data accordingly. To find out what Personal Data we\n            hold on you or to have your Personal Data updated, amended or removed from our database, please email to <a tabindex=\"-1\"\n                href=\"mailto:info@dynamicgroupoffoundations.org\">info@dynamicgroupoffoundations.org</a></p>\n        <li>\n            <h4>Changes to the Website Privacy Policy</h4>\n        </li>\n        <p>\n            Any changes to this Website Privacy Policy will be posted on this website so you are always aware of what information we\n            collect, how we use it, and under what circumstances, if any, we disclose it. If at any time we decide to use\n            Personal Data in a manner significantly different from that stated in this Website Privacy Policy, or otherwise\n            disclosed to you at the time it was collected, we will notify you by email, and you will have a choice as to\n            whether or not we use your information in the new manner.</p>\n\n    </ol>\n</article>"

