module.exports = "<md-card>\n    <article>\n        <h2 class=\"h2\">Organizational Profile</h2>\n        <hr>\n        <h4 class=\"h4 hover\">Dynamic Group of Foundations (DGF)</h4>\n        <p>\n            The Dynamic Group of Foundations is a state level trust under the Indian Trust Act 1882 and Indian Registration Act 1908\n            bearing the Registration Number 27 of 2013 with Head Office located at <i>Khurai Thoudam Leikai, Lamlong, Imphal East, Manipur - 795010</i>.\n            The trust is also registered under Section 12(A) and 80(G) of Income Tax Act, 1961, Government of India.\n        </p>\n        <p>\n            The Dynamic Group of Foundations is a state level trust under the Indian Trust Act 1882 and Indian Registration Act 1908\n            bearing the Registration Number 27 of 2013 with Head Office located at Khurai Thoudam Leikai, Lamlong, Imphal\n            East, Manipur- 795010. The trust is also registered under Section 12(A) and 80(G) of Income Tax Act, 1961, Government\n            of India.\n        </p>\n        <p>\n            To address above mentioned issues, DYNAMIC GROUP OF FOUNDATIONS focuses on three objectives, namely – Education, Health and\n            Economic Development.\n        </p>\n\n    </article>\n</md-card>\n<md-card>\n    <md-tab-group>\n        <md-tab label=\"Our Main Targets\">\n            <md-card>\n                <p>\n                    Dynamic Group of Foundations (DGF) works for the development of the community as a whole. However, the needy target groups\n                    of the projects of DGF are as follows:\n                </p>\n                <ol type=\"i\">\n                    <li>Poor Families</li>\n                    <li>Destitute People</li>\n                    <li>Widows and Widowers</li>\n                    <li>Women</li>\n                    <li>Slum children</li>\n                    <li>Orphans</li>\n                    <li>Differently abled</li>\n                    <li>Poor/ Marginal Farmers</li>\n                    <li>Old aged Persons</li>\n                    <li>Homeless People</li>\n                    <li>Child labour</li>\n                    <li>Children of Backward Classes</li>\n                    <li>Children of Sex Workers</li>\n                    And the likes\n                </ol>\n            </md-card>\n        </md-tab>\n        <md-tab label=\"Our Values\">\n            <article>\n                <md-card>\n                    <p>\n                        Dynamic Group of Foundations(DGF) is committed to providing sustainable development for the underprivileged and vulnerable\n                        members of the population with special focus on children and persons living in difficult circumstances\n                        by acting as a facilitator through community development providing education, vocational training,\n                        health awareness and service, shelter, nutrition counselling, recreation, rescue and rehabilitation,\n                        repatriation awareness on rights, emergency relief, capacity building, fundraising, socio-economic,\n                        cultural and spiritual development regardless of race, sex, religion or politics to achieve goals.\n                        DGF is committed to social justice and work for preservation of human rights. DGF follows the rights\n                        based approach with people participation to evolve and transform to a prosperous future. We thus\n                        follow the People Empowerment model of ministry. DGF acknowledge and nurture the potentials of all\n                        children. We are accountable and transparent to all donors and sponsors.\n                    </p>\n                </md-card>\n            </article>\n        </md-tab>\n        <md-tab label=\"Our Objectives\">\n            <md-card>\n                <p>\n                    The given five domains of evolution, described below, interact to promote sustainable transformation in social, biophysical,\n                    political, economic, spiritual and ecclesiastical systems. The five domains of evolution are:\n                </p>\n                <ol type=\"1\">\n                    <li><b>Well-being of children and families</b></li>\n                    <p>\n                        The Project Goal ensures that the capacities of families and communities for survival and growth will be enhanced through\n                        championing of their human rights towards health and basic education, as well as spiritual and emotional\n                        nurture. Through Economic Development Project, the program have immense scope for the development\n                        of children’s and families’ well-being that further seek opportunity to develop a sustainable household\n                        livelihood with just distribution of resources, capacity to earn a future livelihood, protection\n                        from abuse and exploitation, as well as reduction of the risk of exposure to disasters and HIV/AIDS.\n                    </p>\n                    <li><b>Well-being of children and families</b></li>\n                    <p>Helping the needy children is the core model of development and evolution. The DGF places children as\n                        the centre stage of change and evolution. Children will be participating in the development process\n                        in age-appropriate ways throughout the life of Organization; consequently the children will become\n                        agents of transformation in their families and communities.</p>\n\n                    <li><b>Transformed relationships</b></li>\n                    <p>The Integration of Education, Health & Economic Development Projects creates an environment to interact,\n                        dialogue & build relationship to some degree with the community. Having this opportunity DGF has\n                        scope to address to the need of restoring relationships with each other, the environment, and with\n                        God. Establishing equitable, just, peaceful, productive and inclusive relationships within households\n                        and communities could impact social, political, economic, spiritual and ecclesiastical aspects of\n                        community life. The Economic Development Project will directly deal with the issues of unstable ecosystem\n                        and will help the community to manage environmental resources.</p>\n\n                    <li><b>Interdependent and empowered communities</b></li>\n                    <p>Projects of DGF are road mapped with the success in mind that can be achieved through the strength of\n                        collaboration, coordination, participation & networking. The success of empowerment model can only\n                        be ensured through coalition & networking at local, national, regional & global level on mutual respect,\n                        transparency and ethical/morals responsibility. The road map ensure that DGF will move into building\n                        a culture of people participation that will empower & sustain families and whole communities to influence\n                        and shape their growth and transformation meaningfully.</p>\n\n                    <li><b>Transformed systems and structures</b></li>\n                    <p>DGF also captures the issue of systems & structure of the present target community. Building & Strengthening\n                        community based organisation for leadership role is the top priority of DGF. The community will be\n                        sensitized and made aware of their rights so that just systems and structures would be in the right\n                        place and consequently, the community will have affordable & accessible services & resources for\n                        themselves.\n                    </p>\n                    <h3>Ultimate Goal</h3>\n                    <p>The ultimate goal of DGF in India is that “Community would be able to manage development program, to\n                        have ownership in it, and to take a lead in the betterment of future of the community with the available\n                        funds and resources.”</p>\n\n                    <h3>Our Motto</h3>\n                    <p class=\"hover\"><strong class=\"lead\">Evolve and Transform.</strong></p>\n                </ol>\n            </md-card>\n        </md-tab>\n        <md-tab label=\"Our Board Members\">\n            <md-card>\n                <table class=\"table table-responsive\">\n                    <thead>\n                        <tr>\n                            <th>Sl. No.</th>\n                            <th>Name</th>\n                            <th>Designation</th>\n                            <th>Occupation</th>\n                            <th>Qualification</th>\n                        </tr>\n                    </thead>\n                    <tbody>\n                        <tr *ngFor=\"let member of boardMembers, let i = index\">\n                            <td>{{i+1}}</td>\n                            <td>{{member.name}}</td>\n                            <td>{{member.designation}}</td>\n                            <td>{{member.occupation}}</td>\n                            <td>{{member.qualification}}</td>\n                        </tr>\n                    </tbody>\n                </table>\n            </md-card>\n        </md-tab>\n        <md-tab label=\"Our Advisory Board\">\n            <md-card>\n                <p>\n                    The administration of the Organization would not have been complete without the help and advice of the undermentioned personnel.\n                    Though they do not form a part of the Organization, they play the role of advisors in the Organization.\n                </p>\n                <table class=\"table table-responsive\">\n                    <thead>\n                        <tr>\n                            <th>Sl. No.</th>\n                            <th>Name</th>\n                            <th>Occupation</th>\n                        </tr>\n                    </thead>\n                    <tbody>\n                        <tr>\n                            <td>1</td>\n                            <td>Mr. M. Premjit</td>\n                            <td>Project Director, All Women and Child Development MNGO, Manipur</td>\n                        </tr>\n                        <tr>\n                            <td>2</td>\n                            <td>Mr. T. Lukhoi</td>\n                            <td>Project Director, All Women and Child Development MNGO, Manipur</td>\n                        </tr>\n                        <tr>\n                            <td>3</td>\n                            <td>Mr. Juno Rahman</td>\n                            <td>Lawyer</td>\n                        </tr>\n                    </tbody>\n                </table>\n            </md-card>\n        </md-tab>\n        <md-tab label=\"Funding Details\">\n            <md-card>\n                Dynamic Group of Foundations is funded by Global Fund for Sustainable Development, Germany through the All Women and Children\n                Development, MNGO, Manipur State Region, GF-India, Chingamathak, Imphal, Manipur.\n            </md-card>\n        </md-tab>\n    </md-tab-group>\n</md-card>"

